import React, { useState } from 'react';
import Link from 'next/link'; 

const instaPhotos = [
  '/1-action.jpeg',
  '/2-action.jpeg',
  '/3-action.jpeg',
  '/4-action.jpeg',
  '/5-action.jpeg',
  '/6-action.jpeg',
  '/7-action.jpeg',
  '/8-action.jpeg',
  '/9-action.jpeg',
  '/10-action.jpeg',
  '/11-action.jpeg',
  '/12-action.jpeg',
  '/15-action.jpeg',
  '/17-action.jpeg',
]

function shopInsta(props) {
  const [photos, setPhotos] = useState(instaPhotos)

  return (
    <div className='shop-insta'>
      <h1 className='insta-header'>shop insta</h1>
      <div className='insta-grid'>
        {photos.map((p) => (
          <img className='insta-photo' src='/2-action.jpeg' />
        ))}
      </div>
      <Link href='/'>
        <a>BACK HOME</a>
      </Link>
    </div>
  );
}

export default shopInsta;
